import React from "react";
import { Link } from "react-router-dom";

function Error() {
   return (
      <div>
         <h1>PAGE NOT FOUND</h1>
         <br />
         <Link to='/home'>
            <button name='volver'>Volver para estar seguro</button>
         </Link>
      </div>
   );
}

export default Error;
